  }
}
const Main = () => (
  <main>
    <Switch>
      <Route exact path='/' component={SignIn}/>
      {/* <Route path='/truc' component={Truc}/>
      <Route path='/machin' component={Machin}/> */}
    </Switch>
  </main>
)

